import Feed from "./Feed";
import { Box, Chart } from "@mui/x-data-grid";
import { useState } from "react";

export default function Bodycards() {
  const [series] = useState([
    {
      name: "Sales",
      data: [
        23000, 44000, 55000, 57000, 56000, 61000, 58000, 63000, 60000, 66000,
        34000, 78000,
      ],
    },
  ]);

  const options = {
    xaxis: {
      labels: {
        show: false, // Remove markings from x-axis
      },
    },
    yaxis: {
      labels: {
        show: false, // Remove markings from y-axis
      },
    },
  };

  return (
    <div>
      <div className="bg-white p-4 rounded-md">
        <div>
          <Box sx={{ width: "100%" }}>
            <Chart height={300} series={series} options={options} />
          </Box>
        </div>
      </div>
      <Feed />
    </div>
  );
}

const highlightScope = {
  highlighted: "series",
  faded: "global",
};

const series = [
  {
    label: "series 1",
    data: [
      2423, 2210, 764, 1879, 1478, 1373, 1891, 2171, 620, 1269, 724, 1707, 1188,
      1879, 626, 1635, 2177, 516, 1793, 1598,
    ],
  },
].map((s) => ({ ...s, highlightScope }));
